import React from "react";

const Overview = ({ quoteSummary }) => {
  //   const {
  //     quoteType: { symbol, longName },
  //     summaryDetail: { marketCap },
  //     financialData: { currentPrice },
  //   } = quoteSummary?.quoteSummary?.result[0];

  const { symbol, longName } = quoteSummary?.quoteSummary?.result[0]?.quoteType;
  const { marketCap } = quoteSummary?.quoteSummary?.result[0]?.summaryDetail;
  const { currentPrice } = quoteSummary?.quoteSummary?.result[0]?.financialData;

  return (
    <div className="row">
      <div className="col-6">
        <div className="text-primary">
          {quoteSummary && symbol.replace(".BK", "")}
        </div>
        <div>{quoteSummary && longName}</div>
      </div>
      <div className="col-2">
        <div>{currentPrice.fmt} บาท</div>
        <div>ราคาตลาด</div>
      </div>
      <div className="col-2">
        <div>{marketCap}</div>
        <div>มูลค่าตลาด</div>
      </div>
      <div className="col-2"></div>
    </div>
  );
};

export default Overview;
